script: |
  super -f text -I q5564.spq | sort > q5564.out

inputs:
  - name: q5564.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - 37 * + col0 NOT IN ( + 71, + col0, + col0 * col2, + 67 );
  - name: tab2

outputs:
  - name: q5564.out
    data: |
      46	51	23
      64	77	40
      75	67	58
